script: |
  super -f text -I q1981.spq | sort > q1981.out

inputs:
  - name: q1981.spq
    data: |
      SELECT DISTINCT + 17 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col1 + + - col2 <> NULL AND NOT NULL NOT BETWEEN ( + col0 ) AND ( + 18 );
  - name: tab0

outputs:
  - name: q1981.out
    data: |
